import React, { useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import logo from '../Assets/logo.png'
import '../OfferRide/style.css'
import { Container, Row, Col, Card } from "react-bootstrap";
import { faFontAwesome } from "@fortawesome/free-regular-svg-icons";
import axios from "axios";

const OfferRide: React.FC = () => {
    const [userFromCity, setuserFromCity] = useState<string>("Select");
    const [fromCities, setfromCities] = useState([]);
    const [userToCity, setuserToCity] = useState<string>("Select");
    const [toCities, settoCities] = useState([]);
    const [time, settime] = useState<string>("");
    const [userFromDate, setuserFromDate] = useState();
    const [userToDate, setuserToDate] = useState();
    useEffect(() => {
        const getCities = async () => {
            await axios.get('https://localhost:7243/api/OfferRide/api/OfferRide/TotalCities')
                .then((response) => {
                    setfromCities(response.data)
                    settoCities(response.data)
                })
                .catch((error) => {
                    console.log(error);
                })
        }
        getCities();

    }, [])

    /*function to get all the cities*/
    function displayFromCities() {
        var str = [];
        for (var k = 0; k < (fromCities).length; k++) {
            console.log(k)
            str.push(<option value={fromCities[k]}>{fromCities[k]}</option>)
        }
        return str;
    }
    function displayToCities() {
        var str = [];
        for (var k = 0; k < (toCities).length; k++) {
            console.log(k)
            str.push(<option value={toCities[k]}>{toCities[k]}</option>)
        }
        return str;
    }
    // function openNextCard() {
    //     userFromCity
    // }
    function handleEntailmentRequest(e:any,time:any){
        e.preventDefault();
        settime(time);
    
    };
    function nextClick(e:any){
        e.preventDefault();
        var fromTime = time.split("-")[0];
        var toTime = time.split("-")[1];
        if(toTime.endsWith("pm")){
            toTime = toTime.slice(0,-2);
            var intTime = 12+parseInt(toTime);
            toTime =  intTime.toString();

        }
        else{
            toTime = toTime.slice(0,-2);
        }
        if(fromTime.endsWith("pm")){
            fromTime = fromTime.slice(0,-2);
            var intTime = 12+parseInt(fromTime);
            fromTime =  intTime.toString();
        }
        else{
            fromTime = fromTime.slice(0,-2);
        }
        var fromDate = userFromDate + fromTime;
        var toDate = userFromDate + toTime;
         // if(time[1] == "a" && time[5] == "a" ){
        //     fromDate = userFromDate + time[0-2];
        //     toDate = userToDate + time[4-6];
        // }
        // else if(time[1] == "a" && time[5] == "p" ){
        //     fromDate = userFromDate + time[0-2];
        //     var intTime = 12+parseInt(time[4]);
        //     intTime.toString()
        //     time[4] = intTime
        //     toDate = userToDate + time[4-6];
        // }
        // else if(time[1] == "p" && time[5] == "p" ){
        //     fromDate = userFromDate + time[0-2];
        //     toDate = userToDate + time[4-6];
        // }

        
    }
    function testDate(event:any)
    {
        debugger;
    }
    console.log(time);
    return (
        <Container fluid className='offer-ride-container'>
            <div className="offer-ride-form">
                <div>
                    <Row>
                        <Row className='logo-offerride'>
                            <Col sm={1}>
                                <div>
                                    <img className='logo-img-dashboard' src={logo} alt="logo" />
                                </div>
                            </Col>

                        </Row>
                        <Row>
                            <Col sm={4} className="offer-ride-card-column">

                                <Card>
                                    <div className="title float-left">
                                        <span >
                                            <h1 className="title float-left">Offer a Ride</h1>
                                        </span>
                                        <span>
                                            <label className="switch">
                                                <input type="checkbox" />
                                                <span className="slider round"></span>
                                            </label>
                                        </span>
                                    </div>
                                    <div>
                                        <p className="title-text float-left">we get you the matches asap !</p>
                                    </div>


                                    <Row>
                                        <Col sm={11} >


                                            <div>
                                                <form className="form-for-offering">
                                                    <div className="form-group">
                                                        <label className="from-label form-lables float-left">From</label>
                                                        <select name="employeeDepartment" id="employeeDepartment" className="form-field-value" value={userFromCity}
                                                            onChange={(event) => setuserFromCity(event.target.value)}>
                                                            <option className="dropdown-options" value="Select">Select</option>
                                                            {displayFromCities()}
                                                        </select>
                                                        {/* <input className="form-control no-border" /> */}
                                                    </div>
                                                    <div className="form-group">
                                                        <label className="to-label form-lables float-left">To</label>
                                                        <select name="employeeDepartment" id="employeeDepartment" className="form-field-value" value={userToCity}
                                                            onChange={(event) => setuserToCity(event.target.value)}>
                                                            <option className="dropdown-options" value="Select">Select</option>
                                                            {displayToCities()}
                                                        </select>
                                                        {/* <input className="form-control no-border" /> */}
                                                    </div>
                                                    <div className="form-group">
                                                        <label className="date-label form-lables float-left">Date</label>
                                                        <input type="date"  min={new Date().toISOString().split('T')[0]} name="Date" className="form-control no-border" value={userFromDate}
                                                            onClick={(event) => { setuserFromDate()}} />
                                                        {/* <input type="date" min={new Date().toISOString().split('T')[0]} className="form-control no-border" /> */}

                                                    </div>
                                                    <div className="form-group">
                                                        <Row>
                                                            <label className="time-label form-lables float-left">Time</label>
                                                        </Row>
                                                        <Row>
                                                            <div>
                                                                <button  value={time} onClick={(event) => {handleEntailmentRequest(event,"5am-9am")}} className="time-slot-btn btn-default black-color time-slots-btns">5am-9am</button>


                                                                <button value={time} onClick={(event) => {handleEntailmentRequest(event,"9am-12pm")}} className="time-slot-btn btn-default black-color time-slots-btns">9am-12pm</button>

                                                                <button value={time} onClick={(event) => {handleEntailmentRequest(event,"12pm-3pm")}} className="time-slot-btn btn-default black-color time-slots-btns">12pm-3pm</button>


                                                            </div>
                                                        </Row>
                                                        <Row>
                                                            <div>
                                                                <button value={time} onClick={(event) => {handleEntailmentRequest(event,"3pm-6pm")}} className="time-slots-btn btn-default black-color time-slots-btns">3pm-6pm</button>

                                                                <button value={time} onClick={(event) => {handleEntailmentRequest(event,"6pm-9pm")}} className="time-slots-btn btn-default black-color time-slots-btns">6pm-9pm</button>

                                                            </div>
                                                        </Row>


                                                    </div>
                                                    <button onClick={(event) => {nextClick(event)}} className="next purple-color">Next&gt;&gt;</button>
                                                </form>
                                            </div>

                                        </Col>
                                        <Col sm={1}>
                                            <div className=" leftcard">

                                                <li className="startingPoint purple-color"></li>

                                                <li></li>

                                                <li></li>

                                                <li></li>

                                                <li className="destinationPoint"><i className='fas fa-map-marker-alt i purple-color'></i></li>

                                                <li id="add"><i className='fas fa-plus i'></i></li>

                                            </div>
                                        </Col>
                                    </Row>
                                </Card>
                            </Col>
                            <Col sm={4} className="offer-ride-card-column">

                                <Card>
                                    <div className="title">
                                        <span >
                                            <h1 className="title">Offer a Ride</h1>
                                        </span>
                                        <span>
                                            <label className="switch">
                                                <input type="checkbox" />
                                                <span className="slider round"></span>
                                            </label>
                                        </span>
                                    </div>
                                    {/* <h1>Book a Ride</h1>
                                        <span></span> */}
                                    <div>
                                        <p className="title-text">we get you the matches asap !</p>
                                    </div>


                                    <Row>
                                        <Col sm={11} >

                                            <div>
                                                <form className="form-for-offering">
                                                    <div className="form-group">
                                                        <label className="from-label form-lables float-left">Stop 1</label>
                                                        <input className="form-control no-border" />
                                                    </div>
                                                    <div className="form-group">
                                                        <label className="to-label form-lables float-left">Stop 2</label>
                                                        <input className="form-control no-border" />
                                                    </div>
                                                    <div className="form-group">
                                                        <label className="date-label form-lables float-left">Stop 3</label>
                                                        <input className="form-control no-border" />
                                                    </div>
                                                    <div className="form-group">
                                                        <Row>
                                                            <Col sm={7}>
                                                                <label className="available-seats-label form-lables float-left">Available Seats</label>
                                                            </Col>
                                                            <Col sm={5}>
                                                                <label className="price-for-ride-label form-lables float-left">Price</label>
                                                                <input className="form-control no-border-for-price" placeholder="" />
                                                            </Col>

                                                        </Row>
                                                        <Row>
                                                            <div>
                                                                <button type="submit" className="seat-slot-btn btn-default black-color seat-slots-btns">1</button>

                                                                <button type="submit" className="seat-slot-btn btn-default black-color seat-slots-btns">2</button>

                                                                <button type="submit" className="seat-slot-btn btn-default black-color seat-slots-btns">3</button>

                                                            </div>
                                                        </Row>


                                                    </div>
                                                    <button type="submit" className="btn btn-default">Submit</button>
                                                </form>
                                            </div>

                                        </Col>
                                        <Col sm={1}>
                                            <div className=" leftcard">

                                                <li className="startingPoint"></li>

                                                <li></li>

                                                <li></li>

                                                <li></li>

                                                <li className="destinationPoint"><i className='fas fa-map-marker-alt i'></i></li>

                                                <li id="add"><i className='fas fa-plus i'></i></li>

                                            </div>
                                        </Col>
                                    </Row>
                                </Card>
                            </Col>

                        </Row>
                    </Row>
                </div>
            </div >
        </Container >

    )
}
export default OfferRide;
